import React, {Fragment} from 'react';
import { Grid } from "@material-ui/core";
import AddUserSection from "./AddUserSection";
import DepartmentSection from "./DepartmentSection";
import DashboardDrawer from "../../components/DashboardDrawer/DashboardDrawer";
import {Route, Switch} from "react-router-dom";
import Profile from "../Dashboard/Profile";
import Announcements from "../../components/Announcements/Announcements";
import AddStudentSection from "./AddStudentSection/AddStudentSection";

const AdminSection = props => {
  return (
    <Fragment>
      <Grid container justify={"center"} style={{ marginTop: 72 }}>
        <Grid item xs={12}>
          <Grid container spacing={2}>
            <Grid item xs={12}>
              <AddUserSection />
            </Grid>
            <Grid item xs={12}>
              <DepartmentSection />
            </Grid>
          </Grid>
        </Grid>
      </Grid>
      <Route path={"/dashboard/profile"} render={ props => <Profile { ...props } /> } />
              <Route path={"/dashboard/announcements"} render={ props => <Announcements { ...props } /> } />
              <Route path={"/student/:action"} render={props => <AddStudentSection { ...props } />} />
    </Fragment>
  );
};

export default AdminSection;
